INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (1, 3001100, 2, "2024/10/31 12:00:00", 100, 0.0, 3001, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", "ヤマト", 130011, -416.5, "2030/01/01 14:59:59", 2.1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (4, 3001101, 2, "2024/10/31 12:00:00", 101, 0.0, 3001, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", "ヤマト", 130011, -416.5, "2030/01/01 14:59:59", 5.68);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (1, 3001102, 1, "2024/10/31 12:00:00", 102, 0.0, 3001, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", "ヤマト", 130011, -416.5, "2030/01/01 14:59:59", 0.0);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (1, 3002100, 1, "2024/10/31 12:00:00", 100, 0.0, 3002, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", "フブキ", 130211, -416.5, "2030/01/01 14:59:59", 0.0);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (1, 3002101, 1, "2024/10/31 12:00:00", 101, 0.0, 3002, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", "フブキ", 130211, -416.5, "2030/01/01 14:59:59", 0.0);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (5, 3002102, 2, "2024/10/31 12:00:00", 102, 0.0, 3002, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", "フブキ", 130211, -416.5, "2030/01/01 14:59:59", 8.53);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (7, 3002103, 1, "2024/10/31 12:00:00", 103, 0.0, 3002, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", "フブキ", 130211, -416.5, "2030/01/01 14:59:59", 5.67);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (1, 3002104, 1, "2024/10/31 12:00:00", 104, 0.0, 3002, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", "フブキ", 130211, -416.5, "2030/01/01 14:59:59", 0.0);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (3, 3002300, 3, "2024/10/31 12:00:00", 300, 0.0, 3004, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", "フブキ", 130211, -416.5, "2030/01/01 14:59:59", 0.0);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (7, 3002400, 7, "2024/10/31 12:00:00", 301, 0.0, 3005, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", "フブキ", 130211, -416.5, "2030/01/01 14:59:59", 0.0);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (2, 3003200, 1, "2024/10/31 12:00:00", 200, 0.0, 3003, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", "フブキ", 130211, -416.5, "2030/01/01 14:59:59", 4.4);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (7, 3003201, 7, "2024/10/31 12:00:00", 201, 0.0, 3003, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", "フブキ", 130211, -416.5, "2030/01/01 14:59:59", 0.0);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (1, 3003202, 2, "2024/10/31 12:00:00", 202, 0.0, 3003, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", "フブキ", 130211, -416.5, "2030/01/01 14:59:59", 5.6);
